The Day of Remembrance and Reconciliation ended with a rocket strike on St. George’s Hermitage of the Holy Dormition Svyatogorsk Lavra in Donetsk Region.They have nothing sacred. 
From Feb,24 to May, russians destroyed about a hundred religious buildings in Ukraine.
